@Override
  public void prependTo(@NotNull final RawSqlBuilder builder) {
    for (SqlPart sqlPart : mSelectStatement) {
      sqlPart.prependTo(builder);
      builder.prepend(' ');
    }

    builder.prepend("AS");
  }
